body {
  line-height: 1.2;
}

ol {
  padding-left: 1.4em;
  list-style: none;
}

a {
  text-decoration: none;
}

ul {
  padding-left: 0;
  list-style: none;
  text-decoration: none;
}

table {
  border-collapse: collapse;
  border-spacing: 0;
}

.wrapper {
  width: 100%;
  max-width: 1920px;
  margin: 0 auto;
  font-size: 16px;
  font-family: "Roboto", sans-serif;
  line-height: 30px;
  color: #444444;
}

header {
  width: 100vw;
  max-width: 1920px;
  height: 100%;
  background: url(/494bde84ea71011b5b58fcb96455b6a8.png) no-repeat;
  background-size: contain;
  color: white;
  background-color: #074ECE;
}

header h3 {
  margin: 7% 0 0 20%;
  display: block;
  font-family: "Lato", sans-serif;
  font-size: 3.5em;
  line-height: 66px;
}

nav {
  margin-left: 20%;
  width: 40%;
  padding: 2% 15%;
  background: url(/edeccd06d08b39c9cec51138406711c9.png) no-repeat;
  background-position: left;
  display: flex;
  justify-content: space-between;
  align-items: baseline;
}

li {
  padding-left: 1%;
  margin: 4% 5%;
}

header a {
  color: white;
  white-space: nowrap;
}

ul {
  display: flex;
  flex-direction: row;
}

#free_quote {
  margin-left: 100%;
  padding: 20% 40%;
  background-color: darkturquoise;
  border-radius: 28px;
}

header p {
  margin: 3% 20%;
  color: #E1E1E1;
}

.get_started {
  margin-left: 20%;
  padding-bottom: 5%;
}

.get_started a {
  padding: 15px 52px;
  background-color: darkturquoise;
  border-radius: 28px;
}

#video {
  background: url(/3aed225c75ef51b031146b2fafe95b86.png) no-repeat center center;
  padding: 15px 25px;
  margin-left: 25px;
  background-color: white;
  border-radius: 50px;
}

.top_sections {
  width: 60%;
  margin: 5% auto;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  flex-grow: 1;
}

.top_sections img {
  width: 60%;
}

.top_sections section {
  text-align: center;
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 20vw;
  padding: 5%;
  margin: 0 1vw;
  background-color: #FFFFFF;
  box-shadow: 0px 10px 26px rgba(0, 0, 0, 0.04);
  border-radius: 5px;
}

.top_sections a {
  white-space: nowrap;
  padding: 2% 25%;
  margin-top: 20px;
  color: darkturquoise;
  background-color: #FFFFFF;
  border: 2px solid darkturquoise;
  border-radius: 25px;
}

#section_midle a {
  color: #FFFFFF;
  background-color: darkturquoise;
}

.bottom_section {
  display: flex;
  flex-direction: row;
  flex-grow: 1;
  margin: 5% 21vw;
}

.bottom_section em {
  font-size: 20px;
  color: darkturquoise;
}

#avatar {
  width: 24vw;
  height: 40vh;
  margin-right: 7vh;
}

.bottom_section ul {
  display: inline;
  clear: both;
}

h2 {
  margin: 2vh 0;
  font-weight: bold;
  font-size: 2.8em;
  line-height: 54px;
}

.bottom_section li {
  padding-left: 40px;
  margin: 2vh 0;
  text-align: left;
  background: url(/148b9a0a55a511c7c67fde348a70a8cd.png) no-repeat;
}

.bottom_section p {
  margin: 5vh 0;
}

.bottom_section a {
  margin: 24px 0;
  color: #FFFFFF;
  background-color: darkturquoise;
  white-space: nowrap;
  padding: 2vh 2vw;
  border-radius: 25px;
}

footer {
  background: url(/6649388315440f002d017bb21ff6d089.png) no-repeat;
  background-size: cover;
}

.top {
  display: flex;
  flex-direction: row;
  border: 15px solid #2724e4;
  background-color: #ebf7ff;
  box-shadow: 0px 10px 30px rgba(0, 0, 0, 0.08);
  width: 60vw;
  height: 20vh;
  margin: 0 auto;
  text-align: left;
}

.top h2 {
  color: #171614;
  font-size: 1.2em;
}

.bottoms {
  color: #FFFFFF;
  width: 60%;
  margin: 0 auto;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
}

footer ul {
  display: inline;
}

#sign_up {
  padding: 2%;
  width: 25vw;
}

#email {
  background-color: #FFFFFF;
  position: relative;
  width: 17vw;
  height: 5vh;
  box-shadow: 0px 6px 20px rgba(0, 0, 0, 0.04);
  border-radius: 5px 0px 0px 5px;
}

#email_form {
  color: 777777;
  font-size: 1em;
  height: 4vh;
  position: absolute;
  top: 0;
  left: 0;
  border: none;
  outline: none;
}

#submit {
  position: absolute;
  right: 0;
  width: 3vw;
  height: 5vh;
  border: none;
  background: url(/9907a52b241c6105e40f57d38b22198d.png) no-repeat 50% 50%;
}

#privacy_policy {
  position: absolute;
  left: 550px;
  bottom: -1070px;
}

#dace {
  width: 30%;
}

